import logo from './logo.svg';
import './App.css';
import PlayerList from './components/PlayerList';
import Scheduler from './components/Scheduler';

function App() {
  // Define a list of players with names and phone numbers
  const players = [
    { name: 'Alice', phoneNumber: '123-456-7890' },
    { name: 'Bob', phoneNumber: '234-567-8901' },
    { name: 'Charlie', phoneNumber: '345-678-9012' },
  ];

  return (
    <div className="App">
      <header className="App-header">
        <h1>Tennis Scheduler App</h1>
      </header>
      <main>
        {/* Pass the players array as a prop to the Scheduler component */}
        <Scheduler players={players} />
      </main>
    </div>
  );
}


export default App;
